 const remove = (id) =>{
  axios.delete(`http://localhost:5000/api/products/${id}`).then((result)=>console.log(result,"deleted")).catch(err=>console.log(err))
}

      

  console.log(props.data)
  return (
    <div className='black'>
      {props.data.map((e) => {
        return (<div class="card">
          <p class="heading">
            {e.name}
          </p>
          {<img className='img-card' src={e.imageUrl}></img>}
          <button onClick={()=>                remove(e._id)
}
          >Delete</button>
          <button onClick={()=>{
            navigate("/update", {state:e})
          }}>Update</button>
        </div>)
      })
      }
    </div>
  )
}

export default Home
